  false,\n\t\"url\": null,\n\t\"notes\": \"The following report is a discussion of
  the South Central Overland Trail, which goes west from Salt Lake City and skirts
  the worst of the salt desert, stopping at springs along the way.  This trail was
  used late in western migration and served as the main rapid communication link between
  the east and California, due to being connected to the Pony Express.  This trail
  passes through Fish Springs National Wildlife Refuge, prior to refuge establishment.
  \ Information in this report is from journals, narratives, interviews, and biographies
  of people that used the Overland Trail between 1850-1900.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
